import React from 'react';
import MyInput from "../MyInput/MyInput";

const MyModal = () => {
    return (
        <div>
            <MyInput placeholder='Введите название' />
            <MyInput placeholder='Введите текст' />
            
        </div>
    );
};

export default MyModal;
